import useForm from './hooks/useForm';

const App = () => {
  const [form, handleChange] = useForm({
    name: '', 
    surname: '', 
    email: ''
  });

  return (
    <form>
      <input 
        name='name'
        placeholder='name'
        value= {form.name}
        onChange={handleChange} />
    </form>
  );
}

export default App;
